const REPO   = 'windujm-creator/new-meridian';
const TOKEN  = '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';
const BRANCH = 'main';
const BASE   = 'https://api.github.com';
const headers = {
  'Authorization': `token ${TOKEN}`,
  'Content-Type':  'application/json',
  'User-Agent':    'push86-zm',
};

async function getSHA(path) {
  const r = await fetch(`${BASE}/repos/${REPO}/contents/${path}?ref=${BRANCH}`, { headers });
  if (!r.ok) return null;
  return (await r.json()).sha ?? null;
}

async function pushFile(path, b64) {
  const sha = await getSHA(path);
  const body = { message: `push86: color overhaul + layout fix — ${path.split('/').pop()}`, content: b64, branch: BRANCH };
  if (sha) body.sha = sha;
  const r = await fetch(`${BASE}/repos/${REPO}/contents/${path}`, {
    method: 'PUT', headers, body: JSON.stringify(body),
  });
  if (!r.ok) throw new Error(`Failed ${path}: ${JSON.stringify(await r.json())}`);
  console.log(`  ✅ ${path}`);
}

const FILES = {
  "src/components/layout/ZMSidebar.tsx": "",
  "src/components/layout/Topbar.tsx": "",
  "src/components/layout/AppShell.tsx": "",
  "src/components/shared/GlassCard.tsx": "",
  "src/components/shared/MetricCard.tsx": "",
  "src/components/shared/GlobalStatsBar.tsx": "",
  "src/index.css": "",
};

async function main() {
  console.log('\n🎨 push86 — Color Overhaul + Layout Fix\n');
  for (const [path, b64] of Object.entries(FILES)) {
    process.stdout.write(`  Uploading ${path}...\n`);
    await pushFile(path, b64);
  }
  console.log(`\n✅ push86 done! ${Object.keys(FILES).length} files.`);
  console.log('🌐 https://new-meridian-pearl.vercel.app\n');
  console.log('Changes:');
  console.log('  🎨 Warna: cyan norak → biru elegan (79,127,255)');
  console.log('  🎨 Green: 61,214,140 | Red: 255,102,102 — lebih natural');
  console.log('  📐 Sidebar logo area 84px — tidak kepotong');
  console.log('  📦 MetricCard border ultra-subtle');
  console.log('  🌑 BG lebih hitam pekat (8,10,16)');
}

main().catch(e => { console.error('❌', e.message); process.exit(1); });
